import React, { useState } from 'react';
import {Tabs,Tab,AppBar} from '@mui/material'
import CadastroPeixes from './CadastroPeixes';


export default function TelaCadastro(){
const [value,setValue]=useState(0)
const handleTabs=(e,val)=>{
  console.warn(val)
  setValue(val)
}
  return(
<div>
<h1>React Material UI | Tabs</h1>

{/*<AppBar position="static" >*/}
  <Tabs value={value} onChange={handleTabs} centered>
    <Tab label="ITEM 1"/>
    <Tab label="ITEM 2"/>
    <Tab label="ITEM 3"/>
  </Tabs>
{/*</AppBar>*/}
<TabPanel value={value} index={0} ><CadastroPeixes/></TabPanel>
<TabPanel value={value} index={1}>item 2 Detail</TabPanel>
<TabPanel value={value} index={2}>item 3 Detail</TabPanel>
</div>
    );

}

function TabPanel(props){
  const {children,value,index}=props;
  return(
    <div>
      {
        value===index &&(
          <h1>{children}</h1>
        )
      }
    </div>
  )
}
